function populateBurgers(burgerName, burgerPrice, burgerDescription, burgerImg) {
    const burgerContainer = document.getElementById('section');

    // Create the main container div
    const menuItemDiv = document.createElement("div");
    menuItemDiv.id = "menu-item";

    // Create the image element
    const img = document.createElement("img");
    img.src = burgerImg;
    img.alt = "fake AI burger";
    img.classList.add("item-image");

    // Create the h2 element for the item name
    const itemName = document.createElement("h2");
    itemName.id = "item-name";
    itemName.textContent = burgerName;

    // Create the p element for the item price
    const itemPrice = document.createElement("p");
    itemPrice.id = "item-price";

    // Create the span element for the currency sign
    const currencySign = document.createElement("span");
    currencySign.id = "currencySign";
    currencySign.textContent = "$";

    // Create the text node for the item price value
    const priceValue = document.createTextNode(burgerPrice);

    // Append the currency sign and price value to the item price element
    itemPrice.appendChild(currencySign);
    itemPrice.appendChild(priceValue);

    // Create the p element for the item description
    const itemDescription = document.createElement("p");
    itemDescription.id = "item-description";
    itemDescription.textContent = burgerDescription;

    // Append all elements to the main container div
    menuItemDiv.appendChild(img);
    menuItemDiv.appendChild(itemName);
    menuItemDiv.appendChild(itemPrice);
    menuItemDiv.appendChild(itemDescription);

    // Append the main container div to the desired parent element in your HTML
    burgerContainer.appendChild(menuItemDiv);
    burgerContainer.className = ""
    burgerContainer.classList.add('menu-container')
};



